// SPDX-License-Identifier: MIT
pragma solidity ^0.8.6;

contract MedicalRecords {

    uint recordsCounter = 0;

    struct RecordStruct {
        int client; // Client ID
        uint hospital;
        uint doctor;
        string value;
        uint256 timestamp;
    }

    mapping (uint256 => RecordStruct) public records;

    function setRecord(int _client, uint _hospital, uint _doctor, string memory _value) public {
        records[recordsCounter] = RecordStruct(_client, _hospital, _doctor, _value, block.timestamp);
        recordsCounter++;
    }

    function getRecordsByID(int _client) public view returns (RecordStruct[] memory) {
        RecordStruct[] memory response = new RecordStruct[](recordsCounter);
        uint counter = 0;
        for (uint256 i = 0; i < recordsCounter; i++) {
            if (records[i].client == _client) {
                response[counter] = records[i];
                counter++;
            }
        }
        return response;
    }
}
